The **problem is pre-quantisation**. Any Quantisation code I try, throws the same error.

I've swapped out:
```python
from transformers import (BertConfig, BertForSequenceClassification, BertTokenizer,)
```
for:
```python
from transformers import (AlbertConfig, AlbertForSequenceClassification, AlbertTokenizer,)
```

However, `AlbertConfig` / `BertConfig` is **not** mentioned in the original [Notebook](https://github.com/microsoft/onnxruntime-inference-examples/blob/main/quantization/notebooks/bert/Bert-GLUE_OnnxRuntime_quantization.ipynb).
